import React from "react";
import { Container } from "react-bootstrap";
import AreaChartDiagram from "./AreaChartDiagram";
import BarChartDiagram from "./BarChartDiagram";
import BarChart from "./BarChartDiagram";
import LineChartDiagram from "./LineChartDiagram";
import PieChartDiagram from "./PieChartDiagram";
import StopIcon from "@material-ui/icons/Stop";
import green from "@material-ui/core/colors/green";
import red from "@material-ui/core/colors/red";
const Charts = () => {
  return (
    <>
      <Container
        fluid
        style={{
          padding: "1.5%",
          paddingTop: "0%",
          paddingBottom: "3%",
        }}
      >
        <div>
          <h5 className="mb-3">Charts In React Js </h5>
        </div>
        <div className="text-center text-primary" style={{ fontSize: "48px" }}>
          Line Chart
        </div>
        <div>
          <LineChartDiagram />
        </div>
        <hr />
        <div className="text-center text-primary" style={{ fontSize: "48px" }}>
          Area Chart
        </div>
        <div>
          <AreaChartDiagram />
        </div>
        <hr />
        <div className="text-center text-primary" style={{ fontSize: "48px" }}>
          Bar Chart
        </div>
        <div>
          <BarChartDiagram />
        </div>
        <hr />
        <div className="text-center text-primary" style={{ fontSize: "48px" }}>
          Pie Chart
        </div>
        <div className="text-center ">
          <StopIcon style={{ color: "red" }} />
          <span> No of Student's</span>
          <br />
          <span
            style={{ height: "50px", width: "50px", background: "#555" }}
          ></span>
        </div>

        <div>
          <PieChartDiagram />
        </div>
      </Container>
    </>
  );
};
export default Charts;
